import react from 'react'

import ContentListStyles from './ContentsList.module.scss'

const ContentsList = (props) => {
    console.log(props.data);
    return (
        <react.Fragment>
            {
                <div className={ContentListStyles.container}>

                </div>
            }

        </react.Fragment>
    )
}

export default ContentsList
